class DataValidator:
    def validate_ppop_zip4(self, zip_code: str) -> bool:
        """Validate PPoPZIP+4 codes against Legal Entity ZIP standards."""
        pattern = r'^\d{5}(?:-\d{4})?$'
        return re.match(pattern, zip_code) is not None

    def validate_duns(self, duns_number: str) -> bool:
        """Validate records with expired DUNS."""
        # Simplified validation logic
        return len(duns_number) == 9 and duns_number.isdigit()

    def validate_file_extension(self, filename: str, allowed_extensions: List[str]) -> bool:
        """Check for correct file extensions."""
        return any(filename.lower().endswith(ext) for ext in allowed_extensions)

    def validate_field_lengths(self, data: Dict, schema_def: Dict) -> Dict:
        """Validate field lengths against schema."""
        errors = {}
        for field, value in data.items():
            if field in schema_def:
                max_len = schema_def[field].get('max_length')
                if max_len and len(str(value)) > max_len:
                    errors[field] = f"Exceeds maximum length of {max_len}"
        return errors

