    def optimize_indexes(self, table_name: str, columns: List[str]):
        """Properly index domain models for query optimization."""
        conn = get_db_connection()
        try:
            cursor = conn.cursor()
            for column in columns:
                index_name = f"idx_{table_name}_{column}"
                cursor.execute(f"CREATE INDEX IF NOT EXISTS {index_name} ON {table_name}({column})")
            conn.commit()
        finally:
            conn.close()

