class DataManager:
    def add_gtas_window_data(self, data: List[Dict]):
        """Add GTAS window data to the database."""
        conn = get_db_connection()
        try:
            cursor = conn.cursor()
            cursor.executemany("""
                INSERT INTO gtas_data (window_id, start_date, end_date, amount)
                VALUES (?, ?, ?, ?)
            """, [(d['window_id'], d['start_date'], d['end_date'], d['amount']) for d in data])
            conn.commit()
        finally:
            conn.close()

    def refresh_fabs_records(self):
        """Refresh FABS records with latest data."""
        try:
            conn = get_db_connection()
            cursor = conn.cursor()
            cursor.execute("""
                UPDATE fabs_data
                SET 
                    last_updated = CURRENT_TIMESTAMP,
                    data = (SELECT data FROM external_fabs_source WHERE fabs_data.id = external_fabs_source.id)
                WHERE EXISTS (
                    SELECT 1 FROM external_fabs_source WHERE fabs_data.id = external_fabs_source.id
                )
            """)
            conn.commit()
        finally:
            conn.close()

