class DashboardDesigner:
    def enhance_submission_info(self, submissions: List[Dict]) -> List[Dict]:
        """Enhance submission info on the dashboard."""
        enhanced = []
        for sub in submissions:
            enhanced_sub = sub.copy()
            enhanced_sub['status_label'] = self._get_status_label(sub['status'])
            enhanced_sub['time_in_status'] = str(datetime.now() - datetime.fromisoformat(sub['status_date']))
            enhanced.append(enhanced_sub)
        return enhanced

    def _get_status_label(self, status_code: str) -> str:
        """Get clear status label from code."""
        labels = {
            'P': 'Pending',
            'A': 'Approved',
            'R': 'Rejected',
            'E': 'Error'
        }
        return labels.get(status_code, 'Unknown')

