class DataPublisher:
    def prevent_duplicate_publishing(self, submission_id: str) -> bool:
        """Prevent duplicate transaction publishing."""
        conn = get_db_connection()
        try:
            cursor = conn.cursor()
            cursor.execute("SELECT 1 FROM published_submissions WHERE submission_id = ?", (submission_id,))
            if cursor.fetchone():
                logger.warning(f"Submission {submission_id} already published")
                return False
            return True
        finally:
            conn.close()

    def update_publish_status(self, submission_id: str, new_status: str):
        """Update submissions when publishStatus changes."""
        conn = get_db_connection()
        try:
            cursor = conn.cursor()
            cursor.execute("""
                UPDATE submissions
                SET publish_status = ?, status_updated = CURRENT_TIMESTAMP
                WHERE id = ?
            """, (new_status, submission_id))
            conn.commit()
        finally:
            conn.close()

class HistoricalDataLoader:
    def load_historical_fpds_data(self, data: List[Dict]):
        """Load historical FPDS data."""
        conn = get_db_connection()
        try:
            cursor = conn.cursor()
            cursor.executemany("""
                INSERT INTO historical_fpds (id, agency, amount, date)
                VALUES (?, ?, ?, ?)
                ON CONFLICT(id) DO UPDATE SET
                    agency = excluded.agency,
                    amount = excluded.amount,
                    date = excluded.date
            """, [(d['id'], d['agency'], d['amount'], d['date']) for d in data])
            conn.commit()
        finally:
            conn.close()

    def load_financial_assistance_history(self, data: List[Dict]):
        """Load historical financial assistance data."""
        conn = get_db_connection()
        try:
            cursor = conn.cursor()
            cursor.executemany("""
                INSERT INTO financial_assistance_history
                VALUES (?, ?, ?, ?, ?, ?)
            """, [(d['id'], d['award_id'], d['agency'], d['amount'], d['start_date'], d['end_date']) for d in data])
            conn.commit()
        finally:
            conn.close()

